package com.jobdiva.api.test;

import static java.net.URLEncoder.encode;

import java.io.UnsupportedEncodingException;
import java.util.Collections;
import java.util.List;

import org.springframework.http.client.ClientHttpRequestInterceptor;
import org.springframework.http.client.InterceptingClientHttpRequestFactory;
import org.springframework.web.client.RestTemplate;

/**
 * @author Joseph Chidiac
 *
 */
public class TestUploadResume {
	
	public static final String ENCODING_CHARSET = "UTF-8";
	
	public static String authenticate(Long teamId, String userName, String password) throws Exception {
		//
		try {
			RestTemplate restTemplate = new RestTemplate();
			//
			String teamIdUserName = userName;
			String teamIdPassword = password;
			//
			String token = restTemplate.getForObject("http://127.0.0.1:88/api/authenticate" //
					+ "?clientid=" + teamId //
					+ "&username=" + teamIdUserName //
					+ "&password=" + teamIdPassword//
					, String.class);
			//
			return token;
		} catch (Exception e) {
			//
			//
			throw new Exception(e);
		}
	}
	
	public static String urlEncode(String string) {
		if (string == null) {
			return null;
		}
		try {
			return encode(string, ENCODING_CHARSET);
		} catch (UnsupportedEncodingException e) {
			throw new IllegalStateException("Platform doesn't support " + ENCODING_CHARSET, e);
		}
	}
	
	public static void main(String[] args) throws Exception {
		Long candidateId = 12485655845127L;
		// Long recruiterId = null;
		String resumesource = "0";
		String textFile = "dd";
		// String filecontent =
		// "";
		String resumeDate = "02/01/2021";
		//
		String apiToken = authenticate(1L, "api.user@jobdiva.com", "test1234");
		//
		//
		String parameters = "filename=" + urlEncode("LinkedInExport.pdf");
		parameters += "&textfile=" + urlEncode(textFile);
		if (candidateId != null)
			parameters += "&candidateid=" + candidateId;
		//
		// if (recruiterId != null)
		// parameters += "&recruiterid=" + candidateId;
		parameters += "&resumesource=" + resumesource;
		//
		if (resumeDate != null) {
			parameters += "&resumeDate=" + resumeDate;
		}
		//
		//
		String endpoint = "http://127.0.0.1:88/api/jobdiva/uploadResume?" + parameters;
		//
		RestTemplate restTemplate = new RestTemplate();
		//
		//
		JobDivaBasicAuthorizationInterceptor authorizationInterceptor = new JobDivaBasicAuthorizationInterceptor(apiToken);
		List<ClientHttpRequestInterceptor> interceptors = Collections.<ClientHttpRequestInterceptor> singletonList(authorizationInterceptor);
		//
		//
		restTemplate.setRequestFactory(new InterceptingClientHttpRequestFactory(restTemplate.getRequestFactory(), interceptors));
		//
		Long resumeId = restTemplate.postForObject(endpoint, null, Long.class);
		// Long.class);
		//
		System.out.println(resumeId);
		//
	}
}
